<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Frameset//EN"
"http://www.w3.org/TR/html4/frameset.dtd">
<!-- There's a bug in FireFox with hrefs and xhtml frame sets..
<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Frameset//EN"
"http://www.w3.org/TR/xhtml1/DTD/xhtml1-frameset.dtd"> -->
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
<title>MaxCompiler Timing Analysis</title>
</head>
<frameset rows="80%,20%">
  <frame src="timingreport.xhtml" name="report" />
  <frame name="stacktrace" />
  <noframes>
    <body>
      <p>Your browser needs to support frames in order to display the timing analysis information.</p>
    </body>
  </noframes>
</frameset>
</html>
